import React from 'react';
import LiquidGauge from 'react-liquid-gauge';

function Skills() {
  const gaugeOptions = {
    circleColor: "#4CAF50",
    waveColor: "#45a049",
    textColor: "#333",
    waveTextColor: "#fff",
    textSize: 0.8,
    waveAnimateTime: 1000,
    waveHeight: 0.05,
    waveCount: 1,
  };

  const skillsData = [
    { label: "HTML", value: 80 },
    { label: "Skill2", value: 60 },
    { label: "Skill3", value: 40 },
    { label: "Skill4", value: 20 },
    { label: "Skill5", value: 75 },
  ];

  return (
    <div className="container-fluid software-skills-container-fluid">
      <div className="container">
        <h1>Skills</h1>

        <div className="row">
          
            {skillsData.map((skill, index) => (
            <div className="col-md-3">
              <LiquidGauge
                key={index}
                width={150}
                height={120}
                value={skill.value}
                {...gaugeOptions}
              >
			</LiquidGauge>
               </div>
            ))}
          
          <div className="col-md-6">
            {/* Add more skills or content in the second column if needed */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Skills;
